import React, { useState } from "react";
import CustomButton from "../../../components/button";
import {
  Card,
  CardContent,
  Divider,
  IconButton,
  InputAdornment,
  TextField,
  Typography,
} from "@mui/material";
import "./index.scss";
import { ArrowBack } from "@mui/icons-material";
import { useNavigate } from "react-router-dom";

function RegisterPage() {
  const navigator = useNavigate();
  const [showPassword, setShowPassword] = useState(false);
  const [showConfirmPassword, setShowConfirmPassword] = useState(false);
  const [step, setStep] = useState(1);
  const [formData, setFormData] = useState({});
  const [stepOneError, setStepOneError] = useState({});

  const handleTogglePassword = () => {
    setShowPassword((prevShowPassword) => !prevShowPassword);
  };

  const handleToggleConfirmPassword = () => {
    setShowConfirmPassword((prevShowPassword) => !prevShowPassword);
  };

  const handleNextStep = () => {
    const isStepOneValid = Object.keys(formData).every(
      (key) => formData[key].trim() !== ""
    );

    console.log(!isStepOneValid, formData);

    if (step === 1 && isStepOneValid) {
      setStep(2);
      setStepOneError({}); // Reset error jika ada
    } else if (step === 1) {
      // Jika ada input yang belum diisi, tampilkan pesan error
      const stepOneError = {};
      Object.keys(formData).forEach((key) => {
        if (formData[key].trim() === "") {
          stepOneError[key] = "This field is required";
        }
      });
      setStepOneError(stepOneError);
    }
  };

  const handleBackStep = () => {
    if (step === 2) {
      setStep(1);
    }
  };

  const handleChange = (e) => {
    const { name, value } = e.target;
    setFormData((prevFormData) => ({
      ...prevFormData,
      [name]: value,
    }));
  };

  const handleSubmit = () => {
    console.log(formData);
  };

  return (
    <Card
      className={`login-card ${step === 2 ? "step-entering" : ""}`}
      elevation={0}
    >
      <CardContent>
        {step === 1 && (
          <Typography
            className="title"
            variant="h5"
            component="h2"
            gutterBottom
          >
            Daftar Sekarang
          </Typography>
        )}
        {step === 2 && (
          <Typography
            className="title"
            variant="h5"
            component="h2"
            gutterBottom
            onClick={handleBackStep}
            style={{ cursor: "pointer" }}
          >
            <ArrowBack /> Kembali
          </Typography>
        )}
        <form>
          {step === 1 && (
            <>
              <TextField
                label="Nama Depan"
                name="nama_depan"
                variant="outlined"
                fullWidth
                margin="normal"
                className="login-text-field error"
                onChange={handleChange}
              />
              {stepOneError["nama_depan"] && (
                <span className="error-text">{stepOneError["nama_depan"]}</span>
              )}
              <TextField
                label="Nama Belakang"
                name="nama_belakang"
                variant="outlined"
                fullWidth
                margin="normal"
                onChange={handleChange}
                className="login-text-field"
              />
              <TextField
                label="Email"
                name="email"
                variant="outlined"
                fullWidth
                margin="normal"
                onChange={handleChange}
                className="login-text-field"
              />
            </>
          )}
          {step === 2 && (
            <>
              <TextField
                label="Nomor Telepon"
                name="phone"
                variant="outlined"
                fullWidth
                margin="normal"
                onChange={handleChange}
                className="login-text-field"
              />
              <TextField
                label="Password"
                name="password"
                type={showPassword ? "text" : "password"}
                variant="outlined"
                fullWidth
                size="medium"
                margin="normal"
                onChange={handleChange}
                className="login-text-field"
                InputProps={{
                  endAdornment: (
                    <InputAdornment position="end">
                      <IconButton
                        edge="end"
                        onClick={handleTogglePassword}
                        onMouseDown={(e) => e.preventDefault()}
                      >
                        {showPassword ? (
                          <span className="show-hide-password">Show</span>
                        ) : (
                          <span className="show-hide-password">Hide</span>
                        )}
                      </IconButton>
                    </InputAdornment>
                  ),
                }}
              />
              <TextField
                label="Konfirmasi Password"
                name="confirm_password"
                type={showConfirmPassword ? "text" : "password"}
                variant="outlined"
                fullWidth
                size="medium"
                margin="normal"
                onChange={handleChange}
                className="login-text-field"
                InputProps={{
                  endAdornment: (
                    <InputAdornment position="end">
                      <IconButton
                        edge="end"
                        onClick={handleToggleConfirmPassword}
                        onMouseDown={(e) => e.preventDefault()}
                      >
                        {showConfirmPassword ? (
                          <span className="show-hide-password">Show</span>
                        ) : (
                          <span className="show-hide-password">Hide</span>
                        )}
                      </IconButton>
                    </InputAdornment>
                  ),
                }}
              />
            </>
          )}
          <Divider style={{ height: "39px" }} />
          {step === 1 && (
            <CustomButton
              fullWidth
              paddingProp={"21px"}
              onClick={handleNextStep}
            >
              Selanjutnya
            </CustomButton>
          )}
          {step === 2 && (
            <CustomButton fullWidth paddingProp={"21px"} onClick={handleSubmit}>
              Daftar
            </CustomButton>
          )}
          <div className="register-link">
            <hr />
            <Typography
              variant="body2"
              className="daftar-sekarang"
              color="textSecondary"
            >
              Sudah punya akun?
              <span onClick={() => navigator("/login")}>Masuk</span>
            </Typography>
          </div>
        </form>
      </CardContent>
    </Card>
  );
}

export default RegisterPage;
